To create a custom data type in C++, you can use classes. Here's a simple example of a custom data type called `MyData`:

```cpp
#include <iostream>

class MyData {
private:
    int value;

public:
    // Constructor
    MyData(int v) : value(v) {}

    // Getter
    int getValue() const {
        return value;
    }

    // Setter
    void setValue(int v) {
        value = v;
    }
};

int main() {
    MyData myData(42);
    std::cout << myData.getValue() << std::endl;
    myData.setValue(100);
    std::cout << myData.getValue() << std::endl;
    return 0;
}
```

