def t9_convert(number):
    mapping = {
        '2': 'ABC', '3': 'DEF', '4': 'GHI', '5': 'JKL', '6': 'MNO', '7': 'PQRS', '8': 'TUV', '9': 'WXYZ'
    }
    return ''.join(mapping[str(n)] for n in number)

